import { Component, Input, OnChanges } from '@angular/core';

@Component({
  selector: 'app-card',
  templateUrl: './card.component.html',
  styleUrls: ['./card.component.scss']
})

export class CardComponent implements OnChanges {
  @Input() text: string;
  @Input() title: string;
  @Input() src: string;
  @Input() isActive: string;

  classes: string;

  ngOnChanges() {
    this.classes = this.isActive ? "app-card active" : "app-card";
  }
}

styleUrlsData.data:
.app-card {
  width: fit-content;
  padding: 1px;

  background: rgba(var(--secondary-color-code), 0.5);
  border-radius: 12px;
  text-align: center;

  &.active {
    position: relative;
    background: var(--success-grad-light);

    &::after {
      content: "";
      position: absolute;
      top: 8px;
      right: 8px;

      width: 19px;
      height: 19px;

      background: var(--success-grad-light);
      border-radius: 50%;
    }

    &:before {
      content: '';
      position: absolute;
      top: 8px;
      right: 8px;
      z-index: 2;

      box-sizing: border-box;
      width: 19px;
      height: 19px;
      border-radius: 50%;

      background: no-repeat center url('../../../assets/images/checkbox.svg');
    }
  }

  &:hover {
    background: var(--success-grad-light);
    cursor: pointer;
  }

  &__wrapper {
    border-radius: 12px;
    background-color: var(--text-color);
  }

  &__text-wrapper {
    width: 100%;
    word-wrap: break-word;
  }

  &__container {
    width: 130px;
    padding: 22px 15px 28px;

    border-radius: 12px;
    background-color: rgba(var(--text-color-code), 0.15);
    color: var(--secondary-color);

    display: flex;
    flex-direction: column;
    align-items: center;

      & > img {
        margin-bottom: 20px;
        width: 44px;
        height: 50px;
      }
    }
  }

@media screen and (max-width: 600px) {
  .app-card {
    width: 100%;

    &.active {

      &::after {
        top: 12px;
        left: 58px;
      }
    }

    &__wrapper  {
      width: 100%;
    } 

    &__container {
      flex-direction: row;
      padding: 13px 15px;
      width: 100%;

      & > img {
        margin-right: 50px;
        margin-bottom: 0;
        width: 55px;
        height: 62px;
      }
    }

    &__text-wrapper {
      text-align: center;
      width: 50%;
    }
  }
}

