    position: relative;
    display: block;
    width: 35px;
    height: 12px;

    border-radius: 18px;
    transition: 0.3s;
    background: rgba(var(--secondary-color-code), 0.2);

    &:after {
      content: "";
      position: absolute;
      top: -3px;
      left: 0;

      display: flex;
      justify-content: center;
      align-items: center;

      box-sizing: border-box;
      width: 19px;
      height: 19px;
      border-radius: 50%;

      background: var(--input-bg-color);
      box-shadow: 0px 5px 8px rgba(50, 60, 111, 0.25);
    }
  }
}

.app-checkbox-input-switch:checked + .app-checkbox-input-switch__label {
  background: linear-gradient(89.52deg, hsla(137, 66%, 42%, 0.2) -46.17%, rgba(2, 99, 188, 0.2) 186.99%);

  &:after {
    transform: translateX(17px);
    background: var(--success-grad-light);
  }

  &:before {
    content: '';
    position: absolute;
    top: -3px;
    left: 17px;
    z-index: 2;

    box-sizing: border-box;
    width: 19px;
    height: 19px;
    border-radius: 50%;

    background: no-repeat center url('../../../../../assets/images/checkbox.svg');
  }
}

